// src/components/Arts.js
import React from 'react';
import './Arts.css';

const Arts = () => {
  return (
    <div className="arts-container">
      <h1>Explore Arts & Crafts</h1>
      <div className="arts-grid">
        <div className="art-card">
          <img src="media/arts1.jpg" alt="Traditional Art" />
          <h3>Traditional Art</h3>
          <p>Explore the beauty of traditional crafts.</p>
        </div>
        <div className="art-card">
          <img src="media/arts2.jpg" alt="Modern Art" />
          <h3>Modern Art</h3>
          <p>Experience the creativity of modern art.</p>
        </div>
        <div className="art-card">
          <img src="media/" alt="Handicrafts" />
          <h3>Handicrafts</h3>
          <p>Discover beautiful handmade items.</p>
        </div>
        <div className="art-card">
          <img src="my-mern-project\frontend\public\media\arts1.jpg.webp" alt="Sculpture" />
          <h3>Sculpture</h3>
          <p>Marvel at the craftsmanship of sculptures.</p>
        </div>
      </div>
    </div>
  );
};

export default Arts;
